import React from 'react';
import { Swiper, SwiperSlide } from 'swiper/react';
import 'swiper/css';
import { Mousewheel, Pagination } from 'swiper/modules';

const Time: React.FC = () => {
    const TIME_HOURS = Array.from(Array(24).keys());
    const TIME_MINUTES = Array(12)
        .fill(0)
        .map((num, i) => i * 5);
    return (
        <div className='w-full flex justify-center items-center h-screen'>
            <Swiper
                direction={'vertical'}
                slidesPerView={3}
                mousewheel
                modules={[Mousewheel]}
                loopAdditionalSlides={5}
                slideToClickedSlide
                centeredSlides
                className="h-[160px] px-[1.1rem] border w-[200px]"
            >
                {TIME_HOURS.map((hour) => (
                    <SwiperSlide key={hour}>
                        <div
                            className="flex h-[20px] cursor-pointer items-center"
                        >
                            {(hour + "").padStart(2, "0")}
                        </div>
                    </SwiperSlide>
                ))}
            </Swiper>
        </div>
    );
};

export default Time;
